import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

import Home from "./pages/Home";


const App = function() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={Home}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
